import { useSelector } from "react-redux";

const PieData = () => {
  const { pieData } = useSelector((state) => state.dashData);
  let labels = [];
  let percent = [];
  let backGroundColor = [];
  pieData?.map((el) => {
    labels.push(el.advertiserId);
    percent.push(el.CM001_percent);
    backGroundColor.push("red");
  });
  const data = {
    labels,
    datasets: [
      {
        label: "Pie Chart",
        backgroundColor: backGroundColor,
        data: percent,
      },
    ],
  };
  return (
    <>
      <p>Pie Chart</p>
      <Pie
        data={state}
        options={{
          title: {
            display: true,
            text: "Pie Chart",
            // fontSize: 20,
          },
          legend: {
            display: true,
            position: "right",
            // labels: {
            //   fontSize: 15,
            //   fontColor: "#000",
            // },
          },
        }}
      />
    </>
  );
};

export default PieData;
